CREATE TABLE drwho_episodes(
   season            INTEGER  NOT NULL 
  ,story             VARCHAR(10) NOT NULL
  ,serial            INTEGER 
  ,dr_id             INTEGER  NOT NULL
  ,title             VARCHAR(120) NOT NULL
  ,original_air_date DATE NOT NULL
  ,uk_viewers        NUMERIC(9,2)
  ,all_viewers       NUMERIC(9,2) 
  ,old_new           VARCHAR(3) NOT NULL
);
